def getEraRename(sName, iEra):
	if sName in tEraNames[iEra]:
		return tEraNames[iEra][sName]
	return None

@handler("techAcquired")
def onTechAcquired(iTech, iTeam, iPlayer):
	ownerCities = cities.owner(iPlayer)
	
	for iEra in range(player(iPlayer).getCurrentEra()+1):
		for city in ownerCities:
			sIdentifier = getIdentifier(city.getName())
			if not sIdentifier: 
				sIdentifier = city.getName()
			
			if sIdentifier == 'York' and city.getRegionID() == rBritain: continue # do not rename English York
		
			sNewIdentifier = getEraRename(sIdentifier, iEra)
			if not sNewIdentifier: 
				continue
			
			sNewName = getRenameName(iPlayer, sNewIdentifier)
			if not sNewName:
				sNewName = sNewIdentifier
			
			renameOwnedCity(city, sNewName)

@handler("religionSpread")
def onReligionSpread(iReligion, iPlayer, city):
	iCiv = civ(iPlayer)

	if iCiv == iIndonesia:
		if iReligion == iIslam:
			if city.getName() == 'Yogyakarta': 
				renameOwnedCity(city, "Mataram")
			
	# easter egg
	if iReligion == iBuddhism:
		if city.getName() in ['Buda', 'Budapest', 'Aquincum', 'Akin']: 
			renameOwnedCity(city, "Buddhapest")

@handler("revolution")
def onRevolution(iPlayer):
	if isCommunist(iPlayer):
		applyCommunistNames(iPlayer)
	else:
		revertCommunistNames(iPlayer)
	

@handler("greatPersonBorn")
def onGreatPersonBorn(unit, iPlayer):
	if civ(iPlayer) == iMexico:
		if infos.unit(unit).getGreatPeoples(iSpecialistGreatGeneral):
			for city in cities.owner(iPlayer):
				if city.getName() == "Pitic":
					renameOwnedCity(city, "Hermosillo")


